import React from "react";
import {Container, Paper, Typography, Grid} from "@material-ui/core";
import {makeStyles, withStyles} from "@material-ui/core/styles";
import SvgIcon from "@material-ui/core/SvgIcon";

function HeaderIcon(props) {
    return (
        <SvgIcon fill="none" {...props}>
            <path d="M11.2713 6.61768L9.71289 8.17282L14.775 13.2353L9.71289 18.2978L11.2713 19.853L17.9029 13.2353L11.2713 6.61768Z" />
            <path d="M10.59 10.4227L9.72425 9.55878L6.04004 13.2352L9.72425 16.9117L10.59 16.0477L7.77776 13.2352L10.59 10.4227Z" />
        </SvgIcon>
    )
}

const useStyles = makeStyles(theme => ({
    root: {
        flexGrow: 1,
    },
    container: {
        backgroundColor: '#5d62b5',
        '&:hover': {
            background: '#5d62b5',
        },
        height: 700,
        borderRadius: 30,
        marginTop: 550,
    },
    paddingHeaderFirst: {
        color: '#fff',
        padding: 150,
    },
    paddingSvg: {
        paddingTop: theme.spacing(2),
    },
}));

export default function Who_We_Are() {
const classes = useStyles();

    return (
        <div className={classes.root}>
            <Container maxWidth="lg" className={classes.container}>
                <Grid
                    container
                    justify="flex-start"
                    alignItems="flex-start"
                    className={classes.paddingHeaderFirst}
                >
                    <Grid item sm={0}>
                        <HeaderIcon fontSize="large"/>
                    </Grid>
                    <Grid item sm={2}>
                        <Typography variant="h6" component="body1" >

                            WHO WE ARE
                        </Typography>
                    </Grid>
                </Grid>
            </Container>
        </div>
    );
}
